DROP TABLE IF EXISTS ##TempRecords
SELECT * INTO ##TempRecords FROM #TempRecords

DROP TABLE iF EXISTS ##TempDCA
SELECT BP.acctId, BP.AccountNumber, T1.AccountUUID, T1.TransactionUUID, Amount
INTO ##TempDCA
FROM #TempRecords T1
JOIN BSegment_Primary BP WITH (NOLOCK) ON (T1.AccountUUID = BP.UniversalUniqueID)

SELECT * FROM ##TempDCA WHERE TransactionUUID = '66c9db9f-f94a-44a0-90cc-2093a481541a'

DROP TABLE iF EXISTS ##TempDCA
SELECT T1.AccountUUID, T1.TransactionUUID, t1.Amount
INTO ##TempDCA
FROM #TempRecords T1

SELECT * FROM ##TempDCA

DROP TABLE iF EXISTS #NonPOD1Accounts
SELECT T1.*
INTO #NonPOD1Accounts
FROM #TempRecords T1
LEFT JOIN BSegment_Primary BP WITH (NOLOCK) ON (T1.AccountUUID = BP.UniversalUniqueID)
WHERE BP.UniversalUniqueID IS NULL

SELECT * FROM #NonPOD1Accounts

SELECT RTRIM(AccountNumber) AccountNumber, AccountUUID, TranID, TranTime, Amount TransactionAmount, FINAL_INT_CR_AMT
FROM ##PostWithInterestCredit

SELECT * FROM ##TempRecords

SELECT RTRIM(T1.AccountNumber) AccountNumber, T2.AccountUUID, T2.TranID, T2.TranTime, T2.Amount TransactionAmount, T2.FINAL_INT_CR_AMT, T1.Amount PostedAmount
FROM ##TempRecords T1
JOIN ##PostWithInterestCredit T2 ON (T1.AccountNumber = T2.AccountNumber)


